import React from "react";


//var
//let
//const


const canvas = (props) => {
  let style = {
    backgroundColor: `${props.color}`,
    position:"absolute",
    top: `${props.top} px`,
    left: `${props.left} px`,
    width: '100px',
    length: '100px'
  };
  return <div style={style}></div>
}

export default canvas;
